import React from 'react';
import plaquesCSS from './plaques.css';
import ViewWriteStories from './ViewWriteStories';
import {Link} from 'react-router-dom';


function PlaquesArt() {
  <BrowserRouter>
  <Routes>
    <Route path='/ViewWriteStories' component={<ViewWriteStories />} />
  </Routes>
</BrowserRouter>

  return (
    <div>
      <button as={Link} to="/ViewWriteStories" id="plaque_Lake">The Refuge</button>
      <button id="plaque_House">The Ghibili House</button>
      <button id="plaque_Path">The Carosel Path</button>
      <button id="plaque_Mist">The Cooling Mist</button>
    </div>
  )
}

export default PlaquesArt;
